import React, { useState } from 'react';
import '../styles/Register.css';

function StudentRegister() {
    const [studentData, setStudentData] = useState({
        name: '',
        rollNo: '',
        dob: '',
        registerNo: '',
        branch: '',
        yearOfEntry: '',
        fatherName: '',
        fatherOccupation: '',
        educationOccupation: '',
        familyBackground: '',
        parentsPhone: '',
        address: '',
        languagesKnown: '',
        guardianName: '',
        schoolName: '',
        mediumOfInstruction: '',
        marksMaths: '',
        marksPhysics: '',
        marksChemistry: '',
        cutOff: '',
        quota: '',
        counsellorNames: ['', '', '', '']
    });
    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
          ...formData,
          [name]: value
        });
      };
    
      const handleSubmit = async (e) => {
        e.preventDefault();
    
        try {
          const response = await axios.post('http://localhost:5000/api/students/register', formData);
          console.log('Registration successful:', response.data);
          alert('Student registered successfully');
        } catch (err) {
          console.error('Error registering student:', err);
          alert('Error occurred while registering');
        }
      };

    return (
        <div className="register-container">
            <div className="register-card">
                <h2>Student Registration</h2>
                <form onSubmit={handleSubmit}>
                    <input
                        type="text"
                        placeholder="Student Name"
                        name="name"
                        value={studentData.name}
                        onChange={handleChange}
                        className="register-input"
                        required
                    />
                    <input
                        type="text"
                        placeholder="Roll Number"
                        name="rollNo"
                        value={studentData.rollNo}
                        onChange={handleChange}
                        className="register-input"
                        required
                    />
                    <input
                        type="date"
                        name="dob"
                        value={studentData.dob}
                        onChange={handleChange}
                        className="register-input"
                        required
                    />
                    <input
                        type="text"
                        placeholder="Register Number"
                        name="registerNo"
                        value={studentData.registerNo}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Branch"
                        name="branch"
                        value={studentData.branch}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Year of Entry"
                        name="yearOfEntry"
                        value={studentData.yearOfEntry}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Father's Name"
                        name="fatherName"
                        value={studentData.fatherName}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Father's Occupation"
                        name="fatherOccupation"
                        value={studentData.fatherOccupation}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Education/Occupation"
                        name="educationOccupation"
                        value={studentData.educationOccupation}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <textarea
                        placeholder="Background of Family"
                        name="familyBackground"
                        value={studentData.familyBackground}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Parent's Phone Number"
                        name="parentsPhone"
                        value={studentData.parentsPhone}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Address"
                        name="address"
                        value={studentData.address}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Languages Known"
                        name="languagesKnown"
                        value={studentData.languagesKnown}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Guardian's Name (if any)"
                        name="guardianName"
                        value={studentData.guardianName}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="School Last Studied"
                        name="schoolName"
                        value={studentData.schoolName}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Medium of Instructions in +2"
                        name="mediumOfInstruction"
                        value={studentData.mediumOfInstruction}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Marks in +2 - Maths"
                        name="marksMaths"
                        value={studentData.marksMaths}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Marks in +2 - Physics"
                        name="marksPhysics"
                        value={studentData.marksPhysics}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Marks in +2 - Chemistry"
                        name="marksChemistry"
                        value={studentData.marksChemistry}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Cut Off"
                        name="cutOff"
                        value={studentData.cutOff}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Quota"
                        name="quota"
                        value={studentData.quota}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Counselor's Name (1st Year)"
                        name="counsellorNames[0]"
                        value={studentData.counsellorNames[0]}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Counselor's Name (2nd Year)"
                        name="counsellorNames[1]"
                        value={studentData.counsellorNames[1]}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Counselor's Name (3rd Year)"
                        name="counsellorNames[2]"
                        value={studentData.counsellorNames[2]}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Counselor's Name (Final Year)"
                        name="counsellorNames[3]"
                        value={studentData.counsellorNames[3]}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <button type="submit" className="register-btn">Register Student</button>
                </form>
            </div>
        </div>
    );
}

export default StudentRegister;
